import React from 'react';
import { Link } from 'react-router-dom';
import '../App.css';  // Ensure App.css is correctly imported

function Home() {
    return (
        <div className="home-container">
            {/* Header Section */}
            <header className="header">
                <h1 className="site-title">PiggyBank</h1> {/* Added site title inside header */}
                <nav className="nav">
                    <Link to="/" className="nav-link">Home</Link>
                    <Link to="/deposit" className="nav-link">Save</Link>
                    <Link to="/transactions" className="nav-link">Transactions</Link>
                    <Link to="/goals" className="nav-link">Goals</Link>
                    <Link to="/help" className="nav-link">Help</Link>
                </nav>
            </header>

            {/* Main Content Section */}
            <main className="main-content">
                <div className="cta-section">
                    <h1>Welcome to Your Piggy Bank!</h1>
                    <p>Your savings journey starts here. Make your first deposit now!</p>
                    <Link to="/deposit">
                        <button className="cta-button">Deposit</button>
                    </Link>
                </div>

                {/* Piggy Bank Visual */}
                <div className="piggy-bank-graphic">
                    <img src="/piggy_animation.gif" alt="Piggy Bank" />
                </div>
            </main>
        </div>
    );
}

export default Home;
